import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Card from '../components/Card';
import Carousal from '../components/Carousal'
export default function home() {
  return (
    <div>
       <div> <Navbar/>      </div>
        <div><Carousal/></div>
        <div> <Card/></div>
      
        <div><Footer/></div>
    </div>
  )
}
